import React, {Component} from 'react';
import { Route, Switch, useRouteMatch } from 'react-router';
import { Link } from 'react-router-dom';
import './MenuPage.css';

function MenuPage() {
    return (
        <div className="navigation-menu-page">
            <div className="menu-title-label"></div>      
            <div className="menu-title-divider divider-03"></div>      
            <ul className="app-navigation-container">
              <li className="app-navigation-button border-04" onClick={loadPage('buildsPage')}><Link to="/builds">Builds</Link></li>
              <li className="app-navigation-button border-04" onClick={loadPage('heroesPage')}><Link to="/heroes">Heroes</Link></li>
              <li className="app-navigation-button border-04" onClick={loadPage('loginPage')}><Link to="/login">Login</Link></li>
              <li className="app-navigation-button border-04" onClick={loadPage('registerPage')}><Link to="/register">Register</Link></li>
              <li className="app-navigation-button border-04" onClick={loadPage('aboutPage')}><Link to="/about">About</Link></li>
            </ul>
        </div>
    );
  }

function loadPage(pageName) {
    var root = document.getElementById('root');
    console.log(root);
    root.classList.remove();
    root.classList.add(pageName);
}

export default MenuPage;
